/*Table structure for table `about_starstudents` */

DROP TABLE IF EXISTS `about_starstudents`;

CREATE TABLE `about_starstudents` (
  `about_starstudents_id` int(11) NOT NULL AUTO_INCREMENT,
  `description` longtext NOT NULL,
  PRIMARY KEY (`about_starstudents_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `about_starstudents` */

insert  into `about_starstudents`(`about_starstudents_id`,`description`) values (1,'<p align=\"justify\">Schools have access to either very cheap not working ERP systems, or very expensive ones, which most cannot afford. Plus too much of overhead on implementation of such systems prohibit schools to automate their administrative management processes.</p><br/>\r\n\r\n<p align=\"justify\">Starstudents has one objective - To create 100% usable & affordable ERP software. With so many software solutions available, usability becomes the key. We have put in scientific approach in user experience to make Starstudents usable, so that you can reap the benefits of the tool from the moment you sign up. Schools can go live with this solution in less than 30 seconds without the need of any ICT knowledge or resources. Pure DIY SaaS application for end user delight.</p><br/>\r\n\r\n<p align=\"justify\">Starstudents has been built on a multi-tenant architecture that allows its customers to just click a button and provision their own software without assistance and in less than 30 seconds. Due to this, more than 2600 schools from 135 countries have already adopted Starstudents, and everyday 25 new schools sign up on its platform.</p><br/>\r\n\r\n<p align=\"justify\">Our approach towards automating educational institutions is totally different. Our technology is built around transactional data as well as real time web updates. Using a multi-tenant architecture, Starstudents facilitates the creation of an Enterprise Grade SIS in less than 30 seconds. The application has been designed to be very intuitive so that the end user can immediately go live with this solution without much or no assistance at all.</p><br/>\r\n\r\n<p align=\"justify\">Existing SIS applications are complex to implement and use. Our solution has reduced the time to go live with an SIS from average 6 months to mere 3 days. Plus, the system has been designed for increased end user self service which helps in distributing the workload for raw data entry. Very important aspects of the solution cater to Unified Communications and Online Fee payments, which are expensive and complicated when, attempted to build separately.</p><br/>\r\n\r\n<p align=\"justify\">Overall, the capital expenditure on such software license has been converted to very inexpensive operational expenditure using the SaaS monthly subscription approach.</p><br/>');

