/*Data for the table `faqs` */

insert  into `faqs`(`id`,`title`,`content`,`order`) values (2,'What is Star Students Online Course?','Star Students is a online academy for taking tests and getting certificate for passed courses.',5),(3,'Now that I am enrolled, how do I start my course?','This button will take you into the course itself. Next, look to the top left and you&#039;ll see a Course tab. The Course tab will have the assignments and instructions needed to begin.&lt;br&gt;&lt;br&gt;Enjoy your course!',3),(4,'How do I log in to take an Star Students course?','Once you sign up for a course and activate your account, click on the Sign In button in the upper right corner of the Star Students Course home page, and type in your email address and Star Students password. This will take you to your Star Students dashboard, with access to each of your active courses.&lt;br&gt;&lt;br&gt;The course start dates are listed on your dashboard. After the course begins, you will see a &quot;View course&quot; button. This button will take you into the course itself. Next, look to the top left and you&#039;ll see a Course tab. The Course tab will have the assignments and instructions needed to begin.&lt;br&gt;&lt;br&gt;(Before a course begins, the course will be listed on your dashboard but will not yet have a \"view course\" option.)',2),(5,'Is there a walk-through of a sample course session?','You will learn how to navigate the Star Students Course platform and complete your first course!',0),(6,'Why is the submit button not active? Is the assignment ','The submit button for an assignment will activate once you enter an answer for the assignment, unless the due date has passed. You can see the due date for an assignment under the segment name in the left side menu.',0),(7,'Can I access edX courses on my smartphone or tablet com','Yes, you can use the free Star Students Course mobile app on Android smartphones or on iPhones to take Star Students Courses!&lt;br&gt;&lt;br&gt;The Android app is available in the Google Play Store. The iPhone app is available in the Apple App Store. &lt;br&gt;&lt;br&gt;Most components of your courses will function in the app or a mobile browser, but some might not, depending on the content of the particular course. At times you might need to use a computer with an up-to-date version of Firefox or Chrome to complete tasks. &lt;br&gt;&lt;br&gt;For more information about using the Star Students mobile app, see If You Use the Star Students Mobile App in the Star Students Learner&#039;s Guide.',0),(8,'What happens if I have to quit a course? Will I be able','You can unenroll from an Star Students course at any time. There are absolutely no academic penalties associated with incomplete Star Students studies. You can enroll again for the same course (if it is still offered) at a later time.&lt;br&gt;&lt;br&gt;Note: If you registered and paid for a verified certificate, refunds are only available within 14 days of your payment, or within 14 days after the course begins (whichever comes later). Please note that Professional Education courses offer refunds within 2 days of payment, or up to 2 days after the course start date.',0),(9,'I didn&#039;t finish the Demo course. Can I still start','Yes! The Demo course was created to give you an overview of how Star Students courses work. It is not a required course and is not related to other courses you can take on Star Students Course.',0);

