insert  into `project_types`(`id`,`title`,`fees`,`description`,`recurring`,`period`,`days`) values (3,'Matematika',0,'&lt;p&gt;There are many variations of passages of Lorem Ipsum available, but \nthe majority have suffered alteration in some form, by injected humour, \nor randomised words which don&#039;t look even slightly believable. If you \nare going to use a passage of Lorem Ipsum, you need to be sure there \nisn&#039;t anything embarrassing hidden in the middle of text. All the Lorem \nIpsum generators on the Internet tend to repeat predefined chunks as \nnecessary, making this the first true generator on the Internet.&lt;/p&gt;\n\n                            &lt;p&gt;It uses a dictionary of over 200 Latin \nwords, combined with a handful of model sentence structures, to generate\n Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is \ntherefore always free from repetition, injected humour, or \nnon-characteristic words etc.&lt;/p&gt;',0,'',0),(4,'Bahasa Indonesia',0,'Bahasa Indonesia Online',0,'',0),(6,'PPKN',0,'PPKN Online',0,'',0),(7,'Analyzing and Visualizing Data with Excel',0,'Develop your skills with Excel, one of the common tools that data scientists depend on to gather, transform, analyze, and visualize data.&lt;br&gt;&lt;br&gt;This course is part of the Microsoft Professional Program Certificate in Data Science.&lt;br&gt;&lt;br&gt;Excel is one of the most widely used solutions for analyzing and visualizing data. It now includes tools that enable the analysis of more data, with improved visualizations and more sophisticated business logics. In this data science course, you will get an introduction to the latest versions of these new tools in Excel 2016 from an expert on the Excel Product Team at Microsoft.&lt;br&gt;&lt;br&gt;Learn how to import data from different sources, create mashups between data sources, and prepare data for analysis. After preparing the data, find out how business calculations can be expressed using the DAX calculation engine. See how the data can be visualized and shared to the Power BI cloud service, after which it can be used in dashboards, queried using plain English sentences, and even consumed on mobile devices.&lt;br&gt;&lt;br&gt;Do you feel that the contents of this course is a bit too advanced for you and you need to fill some gaps in your Excel knowledge? Do you need a better understanding of how pivot tables, pivot charts and slicers work together, and help in creating dashboards? If so, check out DAT205x: Introduction to Data Analysis using Excel.&lt;br&gt;&lt;br&gt;What you&#039;ll learn&lt;br&gt;&lt;br&gt;- Gather and transform data from multiple sources&lt;br&gt;- Discover and combine data in mashups&lt;br&gt;- Learn about data model creation&lt;br&gt;- Explore, analyze, and visualize data',0,'D',10);

