insert  into `resources`(`id`,`category`,`title`,`content`) values (1,8,'How Secure Is My Password?','It has been said that astronomy is a humbling and character-building experience. There is perhaps no better demonstration of the folly of human conceits than this distant image of our tiny world. To me, it underscores our responsibility to deal more kindly with one another, and to preserve and cherish the pale blue dot, the only home weâ€™ve ever known.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 24px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;font color=&quot;#383838&quot; face=&quot;Open Sans, Helvetica, Arial, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 15px; line-height: 24px;&quot;&gt;&amp;nbsp;Think of the rivers of blood spilled by all those generals and emperors so that, in glory and triumph, they could become the momentary masters of a fraction of a dot.It has been said that astronomy is a humbling and character-building experience. There is perhaps no better demonstration of the folly of human conceits than this distant image of our tiny world. To me, it underscores our responsibility to deal more kindly with one another, and to preserve and cherish the pale blue dot, the only home weâ€™ve ever known. The Earth is a very small stage in a vast cosmic arena. Think of the rivers of blood spilled by all those generals and emperors so that, in glory and triumph, they could become the momentary masters of a fraction of a dot.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 24px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;font color=&quot;#383838&quot; face=&quot;Open Sans, Helvetica, Arial, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 15px; line-height: 24px;&quot;&gt;&lt;b&gt;It has been said that astronomy is a humbling and character-building experience.&amp;nbsp;&lt;/b&gt;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing