color: rgb(26, 26, 26); line-height: 32px; font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; background-color: rgb(255, 255, 255);&quot;&gt;The Earth&lt;/h2&gt;&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 24px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;Look again at that dot. Thatâ€™s here. Thatâ€™s home. Thatâ€™s us. On it everyone you love, everyone you know, everyone you ever heard of,&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;&amp;nbsp;every human being&lt;/strong&gt;&amp;nbsp;who ever was, lived out their lives. The aggregate of our joy and suffering, thousands of confident religions, ideologies, and economic doctrines, every hunter and forager, every hero and coward, every creator and destroyer of civilization, every king and peasant, every young couple in love, every mother and father, hopeful child, inventor and explorer, every teacher of morals, every corrupt politician, every â€œsuperstar,â€ every â€œsupreme leader,â€ every saint and sinner in the history of our species lived thereâ€“on a mote of dust suspended in a sunbeam.&lt;/p&gt;&lt;h3 style=&quot;box-sizing: border-box; font-size: 24px; margin: 36px 0px 24px; color: rgb(26, 26, 26); line-height: 30px; font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; background-color: rgb(255, 255, 255);&quot;&gt;Houston&lt;/h3&gt;&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 24px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;that may have seemed like a very long final phase. The autotargeting was taking us right into a â€¦ crater, with a large number of big boulders and rocks â€¦ and it required â€¦ flying manually over the rock field to find a reasonably good area.&lt;/p&gt;&lt;ul style=&quot;box-sizing: border-box; margin: 0px 0px 24px 48px; padding: 0px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;I am a stranger. I come in peace. Take me to your leader and there will be a massive reward for you in eternity.&lt;/li&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;A good rule for rocket experimenters to follow is this: always assume that it will explode.&lt;/li&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;Letâ€™s light this fire one more time, Mike, and witness this great nation at its best.&lt;/li&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;Itâ€™s just mind-blowingly awesome. I apologize, and I wish I was more articulate, but itâ€™s hard to be articulate when your mindâ€™s blownâ€”but in a very good way.&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 24px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;The view of the Earth from the Moon fascinated meâ€”a small disk, 240,000 miles away. It was hard to think that that little thing held so many problems, so many frustrations. Raging nationalistic interests, famines, wars, pestilence donâ€™t show from that distance.&lt;/p&gt;&lt;h3 style=&quot;box-sizing: border-box; font-size: 24px; margin: 36px 0px 24px; color: rgb(26, 26, 26); line-height: 30px; font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; background-color: rgb(255, 255, 255);&quot;&gt;Flight Control&lt;/h3&gt;&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 24px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;From this day forward, Flight Control will be known by two words: â€˜Toughâ€™ and â€˜Competent.â€™ Tough means we are forever accountable for what we do or what we fail to do. We will never again compromise our responsibilities. Every time we walk into Mission Control we will know what we stand for. Competent means we will never take anything for granted. We will never be found short in our knowledge and in our skills. Mission Control will be perfect. When you leave this meeting today you will go to your office and the first thing you will do there is to write â€˜Tough and Competentâ€™ on your blackboards. It will never be erased. Each day when you enter the room these words will remind you of the price paid by Grissom, White, and Chaffee. These words are the price of admission to the ranks of Mission Control.&lt;/p&gt;&lt;ol style=&quot;box-sizing: border-box; margin: 0px 0px 24px 48px; padding: 0px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;Itâ€™s just mind-blowingly awesome. I apologize, and I wish I was more articulate, but itâ€™s hard to be articulate when your mindâ€™s blownâ€”but in a very good way.&lt;/li&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;The vehicle explodes, literally explodes, off the pad. The simulator shakes you a little bit, but the actual liftoff shakes your entire body and soul.&lt;/li&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;The surface is fine and powdery. I can kick it up loosely with my toe.&lt;/li&gt;&lt;/ol&gt;&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 24px; color: rg