;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;The view of the Earth from the Moon fascinated meâ€”a small disk, 240,000 miles away. It was hard to think that that little thing held so many problems, so many frustrations. Raging nationalistic interests, famines, wars, pestilence donâ€™t show from that distance.&lt;/p&gt;&lt;h3 style=&quot;box-sizing: border-box; font-size: 24px; margin: 36px 0px 24px; color: rgb(26, 26, 26); line-height: 30px; font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; background-color: rgb(255, 255, 255);&quot;&gt;Flight Control&lt;/h3&gt;&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 24px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;From this day forward, Flight Control will be known by two words: â€˜Toughâ€™ and â€˜Competent.â€™ Tough means we are forever accountable for what we do or what we fail to do. We will never again compromise our responsibilities. Every time we walk into Mission Control we will know what we stand for. Competent means we will never take anything for granted. We will never be found short in our knowledge and in our skills. Mission Control will be perfect. When you leave this meeting today you will go to your office and the first thing you will do there is to write â€˜Tough and Competentâ€™ on your blackboards. It will never be erased. Each day when you enter the room these words will remind you of the price paid by Grissom, White, and Chaffee. These words are the price of admission to the ranks of Mission Control.&lt;/p&gt;&lt;ol style=&quot;box-sizing: border-box; margin: 0px 0px 24px 48px; padding: 0px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;Itâ€™s just mind-blowingly awesome. I apologize, and I wish I was more articulate, but itâ€™s hard to be articulate when your mindâ€™s blownâ€”but in a very good way.&lt;/li&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;The vehicle explodes, literally explodes, off the pad. The simulator shakes you a little bit, but the actual liftoff shakes your entire body and soul.&lt;/li&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;The surface is fine and powdery. I can kick it up loosely with my toe.&lt;/li&gt;&lt;/ol&gt;&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 24px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;The vehicle explodes, literally explodes, off the pad. The simulator shakes you a little bit, but the actual liftoff shakes your entire body and soul.&lt;/p&gt;&lt;h2 style=&quot;box-sizing: border-box; font-size: 26px; margin: 36px 0px 24px; color: rgb(26, 26, 26); line-height: 32px; font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; background-color: rgb(255, 255, 255);&quot;&gt;The Future&lt;/h2&gt;&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 24px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;I am a stranger. I come in peace. Take me to your leader and there will be a massive reward for you in eternity.&lt;/p&gt;'),(13,9,'Our Content Policy','&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 24px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;It has been said that astronom