/*Table structure for table `transport` */

DROP TABLE IF EXISTS `transport`;

CREATE TABLE `transport` (
  `transport_id` int(11) NOT NULL AUTO_INCREMENT,
  `route_name` longtext COLLATE utf8_unicode_ci NOT NULL,
  `number_of_vehicle` longtext COLLATE utf8_unicode_ci NOT NULL,
  `description` longtext COLLATE utf8_unicode_ci NOT NULL,
  `route_fare` longtext COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`transport_id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `transport` */

insert  into `transport`(`transport_id`,`route_name`,`number_of_vehicle`,`description`,`route_fare`) values (1,'None','None','None','0');

/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `firstname` varchar(255) NOT NULL,
  `lastname` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `password` varchar(200) NOT NULL,
  `ip` varchar(90) NOT NULL,
  `date` varchar(90) NOT NULL,
  `is_active` int(1) NOT NULL,
  `rank` int(1) NOT NULL,
  `img_profile` varchar(200) NOT NULL DEFAULT 'uploads_md5/avatar_profile.png',
  `img_background` varchar(200) NOT NULL,
  `profile_description` longtext NOT NULL,
  `last_update` varchar(200) NOT NULL,
  `birthday` varchar(10) NOT NULL DEFAULT '1-1-1990',
  `comment_privacy` varchar(15) NOT NULL DEFAULT 'everyone',
  `confirm_followers` int(1) NOT NULL DEFAULT '0',
  `current_city` text NOT NULL,
  `follow_privacy` varchar(15) NOT NULL DEFAULT 'everyone',
  `gender` varchar(6) NOT NULL,
  `hometown` text NOT NULL,
  `mailnotif_comment` tinyint(1) NOT NULL DEFAULT '1',
  `mailnotif_postlike` tinyint(1) NOT NULL DEFAULT '1',
  `mailnotif_postshare` tinyint(1) NOT NULL DEFAULT '1',
  `mailnotif_follow` tinyint(1) NOT NULL DEFAULT '1',
  `mailnotif_friendrequests` tinyint(1) NOT NULL DEFAULT '1',
  `mailnotif_groupjoined` tinyint(1) NOT NULL DEFAULT '1',
  `mailnotif_message` tinyint(1) NOT NULL DEFAULT '1',
  `mailnotif_pagelike` tinyint(1) NOT NULL DEFAULT '1',
  `mailnotif_timelinepost` tinyint(1) NOT NULL DEFAULT '1',
  `message_privacy` varchar(15) NOT NULL DEFAULT 'everyone',
  `post_privacy` varchar(15) NOT NULL DEFAULT 'everyone',
  `social_login_facebook` varchar(25) NOT NULL,
  `social_login_google` varchar(25) NOT NULL,
  `social_login_instagram` varchar(25) NOT NULL,
  `social_login_linkedin` varchar(25) NOT NULL,
  `social_login_twitch` varchar(25) NOT NULL,
  `social_login_twitter` varchar(25) NOT NULL,
  `social_login_vk` varchar(25) NOT NULL,
  `timeline_post_privacy` varchar(15) NOT NULL DEFAULT 'everyone',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`email`)
