/*!50001 CREATE TABLE  `view_class_schedule`(
 `class_routine_id` int(11) ,
 `class_id` int(11) ,
 `section_id` int(11) ,
 `subject_id` int(11) ,
 `time_start` varchar(11) ,
 `time_start_min` varchar(11) ,
 `time_end` varchar(11) ,
 `time_end_min` varchar(11) ,
 `day` longtext ,
 `year` longtext ,
 `name` longtext 
)*/;

/*View structure for view view_class_schedule */

/*!50001 DROP TABLE IF EXISTS `view_class_schedule` */;
/*!50001 DROP VIEW IF EXISTS `view_class_schedule` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`stars`@`%` SQL SECURITY DEFINER VIEW `view_class_schedule` AS (select `c`.`class_routine_id` AS `class_routine_id`,`c`.`class_id` AS `class_id`,`c`.`section_id` AS `section_id`,`c`.`subject_id` AS `subject_id`,`c`.`time_start` AS `time_start`,`c`.`time_start_min` AS `time_start_min`,`c`.`time_end` AS `time_end`,`c`.`time_end_min` AS `time_end_min`,`c`.`day` AS `day`,`c`.`year` AS `year`,`s`.`name` AS `name` from (`class_routine` `c` join `subject` `s` on((`s`.`subject_id` = `c`.`subject_id`))) group by `c`.`class_id`,`c`.`section_id`,`c`.`time_start`,`c`.`time_start_min`,`c`.`time_end`,`c`.`time_end_min`,`c`.`day`,`c`.`year` order by `c`.`day`) */;

